SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

CREATE TABLE IF NOT EXISTS `webshop_structure` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `structure` longtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=96 ;



CREATE TABLE IF NOT EXISTS `crawllist` (
  `wid` int(11) NOT NULL,
  `last_crawled` int(11) NOT NULL,
  `currentlybeingcrawled` int(11) DEFAULT NULL,
  `email_me` tinyint(1) NOT NULL DEFAULT '0',
  `last_updated` int(11) NOT NULL,
  `crawl_interval` int(11) NOT NULL DEFAULT '1209600',
  `update_interval` int(11) NOT NULL DEFAULT '86400',
  `update_mode_supported` tinyint(1) NOT NULL DEFAULT '0',
  `scrape_asap` int(11) NOT NULL DEFAULT '1',
  `status` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'not_set',
  PRIMARY KEY (`wid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;





CREATE TABLE IF NOT EXISTS `crawl_log` (
  `wid` int(11) NOT NULL,
  `time` int(11) NOT NULL,
  `products` int(11) NOT NULL,
  `mode` enum('full','update') COLLATE utf8_unicode_ci DEFAULT NULL,
  `initial_products` int(11) DEFAULT NULL,
  UNIQUE KEY `wid` (`wid`,`time`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




CREATE TABLE IF NOT EXISTS `subscription_packages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `price` float NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `max_products` int(11) NOT NULL,
  `price_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `price_id` (`price_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=8 ;




CREATE TABLE IF NOT EXISTS `customers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `wid` int(11) NOT NULL,
  `email` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `pwd` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `session` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `cookie` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `ip` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `company` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `address` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `address2` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `postal` int(10) NOT NULL,
  `city` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `phone` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email_activated` tinyint(1) NOT NULL DEFAULT '1',
  `soap_type` int(11) NOT NULL DEFAULT '0',
  `master_id` int(11) NOT NULL DEFAULT '0',
  `on_config` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `wid` (`wid`),
  UNIQUE KEY `email` (`email`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=5 ;




CREATE TABLE IF NOT EXISTS `webshop_types` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `version` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=7 ;






CREATE TABLE IF NOT EXISTS `search_templates` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `attributes` longtext COLLATE utf8_unicode_ci NOT NULL,
  `standard_attributes` text COLLATE utf8_unicode_ci NOT NULL,
  `type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=5 ;






CREATE TABLE IF NOT EXISTS `settings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `long_name_dep` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description_dep` text COLLATE utf8_unicode_ci,
  `value` text COLLATE utf8_unicode_ci NOT NULL,
  `possible_values` text COLLATE utf8_unicode_ci,
  `public` tinyint(1) NOT NULL,
  `type` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'text',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=133 ;




CREATE TABLE IF NOT EXISTS `settings_descriptions` (
  `settings_id` int(11) NOT NULL,
  `lang_id` int(11) NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `long_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`settings_id`,`lang_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



CREATE TABLE IF NOT EXISTS `webshop_relations` (
  `wid` int(11) NOT NULL,
  `parent` int(11) NOT NULL,
  PRIMARY KEY (`wid`,`parent`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;










CREATE TABLE IF NOT EXISTS `dontcarewords` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `word` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `word` (`word`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=119 ;




CREATE TABLE IF NOT EXISTS `thesaurus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `short` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  `word` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `short` (`short`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=11572 ;




CREATE TABLE IF NOT EXISTS `thesaurus_links` (
  `entrance` int(11) NOT NULL,
  `out` int(11) NOT NULL,
  PRIMARY KEY (`entrance`,`out`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




CREATE TABLE IF NOT EXISTS `webshops` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Public name',
  `hostname` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Uden http og www og uden /',
  `type` int(11) NOT NULL,
  `enabled` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'DEPRECATED!!!',
  `seckey` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `debug` tinyint(1) NOT NULL DEFAULT '0',
  `pack_id` int(11) NOT NULL,
  `next_pack_id` int(11) NOT NULL,
  `paydate` int(11) NOT NULL,
  `transactionnum` int(11) DEFAULT NULL,
  `is_trial` tinyint(1) NOT NULL DEFAULT '1',
  `test_shop` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `transactionnum` (`transactionnum`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=84 ;

 
CREATE TABLE IF NOT EXISTS `result_display_identifiers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=10 ;




CREATE TABLE IF NOT EXISTS `soap_user_types` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` text COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=3 ;






CREATE TABLE IF NOT EXISTS `configuration_progress` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `conf_steps_id` int(11) NOT NULL,
  `start` int(11) NOT NULL,
  `finish` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=481 ;









CREATE TABLE IF NOT EXISTS `standard_values` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `value` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=3 ;








CREATE TABLE IF NOT EXISTS `onargi_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `time` int(11) NOT NULL,
  `hash` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `count` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `hash` (`hash`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=2663 ;








CREATE TABLE IF NOT EXISTS `languages` (
  `id` int(11) NOT NULL,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `iso` varchar(2) COLLATE utf8_unicode_ci NOT NULL,
  `locale` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




CREATE TABLE IF NOT EXISTS `prices` (
  `price_id` int(11) NOT NULL AUTO_INCREMENT,
  `language_id` int(11) NOT NULL,
  `value` decimal(20,4) NOT NULL,
  `currency` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`price_id`,`language_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=5 ;





CREATE TABLE IF NOT EXISTS `settings_descriptions` (
  `settings_id` int(11) NOT NULL,
  `lang_id` int(11) NOT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `long_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`settings_id`,`lang_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




